import React, { useState } from 'react'

export function uploadedAsset (imageUrl) {
    if(!imageUrl === "") {
        const urlOfLastUpload = imageUrl
    }    

    if(assetUrl === ""){
        const assetUrl = urlOfLastUpload
    } else {
        assetUrl = imageUrl
    }

    return assetUrl
}
